import {useState} from "react";
import Contact from "./Contact"
import Home from "./Home"

function Images() {

  const fetchImage = () => {
    const requestOptions = {
      method: 'GET',
      header: { 'Content-Type': 'application/json'}
      // {, 'Access-Control-Allow-Origin': '*', 'Accept': 'application/json', "Access-Control-Allow-Methods": "GET" },
      // mode: 'cors'
    };
    fetch('http://' + host + ':' + port + '/image_preprocessing', requestOptions)
      .then(response => response.json())
      .then(result => {
        setMeta({
          meta: result.map(item => ({
            panoid: item[0],
            month: item[1],
            idx: item[2],
            angle: item[3],
            head: item[4],
            cluster: item[5],
            pp: item[6],
            pp_float: item[8]
          }))
        });
      });
  };

  return (
    <div className="App">
      <p>Images</p>
    </div>
  );
}
export default Images;
